import React from "react";
import ReactDOM from "react-dom";
import styled from "@emotion/styled";

ReactDOM.render(
  <h1>
    <a>hi</a>
    Hello, world!
  </h1>,
  document.getElementById("root")
);
console.log("Hello, world!");

const a = styled.div`
  color: red;
  textcolor: blue;
`;
